        protected static void Fill_Xml_Internal(
            SoulGem item,
            XElement root,
            string name,
            ErrorMaskBuilder errorMask,
            TranslationCrystal translationMask)
        {
            switch (name)
            {
                case "Name":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.Name);
                        if (StringXmlTranslation.Instance.Parse(
                            root: root,
                            item: out String NameParse,
                            errorMask: errorMask))
                        {
                            item.Name = NameParse;
                        }
                        else
                        {
                            item.UnsetName();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Model":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.Model);
                        if (LoquiXmlTranslation<Model>.Instance.Parse(
                            root: root,
                            item: out Model ModelParse,
                            errorMask: errorMask,
                            translationMask: translationMask?.GetSubCrystal((int)SoulGem_FieldIndex.Model)))
                        {
                            item.Model = ModelParse;
                        }
                        else
                        {
                            item.UnsetModel();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Icon":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.Icon);
                        if (StringXmlTranslation.Instance.Parse(
                            root: root,
                            item: out String IconParse,
                            errorMask: errorMask))
                        {
                            item.Icon = IconParse;
                        }
                        else
                        {
                            item.UnsetIcon();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Script":
                    FormIDXmlTranslation.Instance.ParseInto(
                        root: root,
                        item: item.Script_Property,
                        fieldIndex: (int)SoulGem_FieldIndex.Script,
                        errorMask: errorMask);
                    break;
                case "Value":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.Value);
                        if (UInt32XmlTranslation.Instance.Parse(
                            root: root,
                            item: out UInt32 ValueParse,
                            errorMask: errorMask))
                        {
                            item.Value = ValueParse;
                        }
                        else
                        {
                            item.UnsetValue();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Weight":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.Weight);
                        if (FloatXmlTranslation.Instance.Parse(
                            root: root,
                            item: out Single WeightParse,
                            errorMask: errorMask))
                        {
                            item.Weight = WeightParse;
                        }
                        else
                        {
                            item.UnsetWeight();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "ContainedSoul":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.ContainedSoul);
                        if (EnumXmlTranslation<SoulLevel>.Instance.Parse(
                            root: root,
                            item: out SoulLevel ContainedSoulParse,
                            errorMask: errorMask))
                        {
                            item.ContainedSoul = ContainedSoulParse;
                        }
                        else
                        {
                            item.UnsetContainedSoul();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "MaximumCapacity":
                    try
                    {
                        errorMask?.PushIndex((int)SoulGem_FieldIndex.MaximumCapacity);
                        if (EnumXmlTranslation<SoulLevel>.Instance.Parse(
                            root: root,
                            item: out SoulLevel MaximumCapacityParse,
                            errorMask: errorMask))
                        {
                            item.MaximumCapacity = MaximumCapacityParse;
